import Logo from "../assets/logo.png";
import Nav from "../components/nav";
import Slider from "../components/carousel";

const Header = () => {
  return (
    <div>
      <div>
      <div className="header">
        <div className="headerlogo">
          <img src={Logo} className="Logo"></img>
        </div>
        <Nav />
      </div>
      </div>
      <Slider />
    </div>
  );
};

export default Header;
